  [],\n\t\"num_tags\": 0,\n\t\"name\": \"marine-bird-sighting-wind-and-other-data-from-the-discoverer-and-other-platforms-as-part-of-the\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Marine bird sighting, wind, and other data
  were collected from NOAA Ship DISCOVERER and other platforms from 02 July 1975 to
  01 September 1978. Data were collected by the Fish and Wildlife Service (FWS) and
  the University of Washington (UW) as part of the Outer Continental Shelf Environmental
  Assessment Program (OCSEAP). Data were processed by NODC to the NODC standard F033
  Marine Bird Sighting, Ship/Aircraft Census and the F101 Ocean Wind Time Series from
  Buoys formats. Full format descriptions are available from the NODC homepage at
  www.nodc.noaa.gov/. An analog file for this accession is available from NODC user
  services.nnThe F033 format contains data from field observations of marine birds
  made along ship or aircraft survey tracks. These data are collected to provide information
  on population density and distribution. Start and end position, date and elapsed
  time, speed and course, platform type and observing techniques are reported for
  each survey. Environmental information may include meteorological and sea surface
  conditions, distances to the shoreline and shelf break, ice characteristics within
  and outside each transect and surface debris, including oil slicks. Species data
  may include age, sex, color, plumage, number of individuals, direction of flight,
  behavior and food source association. Any number of species may be reported within
  one observation time span.nnThe F101 format contains time series measurements of
  wind and other surface meteorological parameters taken at fixed locations. The instrument
  arrays may be deployed on automated buoys, ships, or towers. The data record includes
  values of east-west (u) and north-south (v) wind components at specified date and
  time. Wind values may have been averaged or filtered and are typically reported
  at time intervals of 10-15 minutes. Air temperature, atmospheric pressure, and dew
  point temperatures may also be reported.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
